<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <title>Theodo - Node, Symfony, Php, AngularJs, React, Ansible, Devops</title>
    <link rel="icon" type="image/png" sizes="64x64" href="/static/img/icons/favicon.ico">
    <!--[if IE]><link rel="shortcut icon" href="/static/img/icons/favicon.ico"><![endif]-->
    <!-- Add to home screen for Android and modern mobile browsers -->
    <link rel="manifest" href="/static/manifest.json">
    <meta name="theme-color" content="#69be9f">

    <!-- Add to home screen for Safari on iOS -->
    <meta name="apple-mobile-web-app-capable" content="yes">
    <meta name="apple-mobile-web-app-status-bar-style" content="black">
    <meta name="apple-mobile-web-app-title" content="vuejs-theodo-blog">
    <link rel="apple-touch-icon" href="/static/img/icons/apple-touch-icon-152x152.png">
    <!-- Add to home screen for Windows -->
    <meta name="msapplication-TileImage" content="/static/img/icons/msapplication-icon-144x144.png">
    <meta name="msapplication-TileColor" content="#000000">

    <link rel="stylesheet" id="open-sans-css" href="https://fonts.googleapis.com/css?family=Open+Sans%3A300italic%2C400italic%2C600italic%2C300%2C400%2C600&#038;subset=latin%2Clatin-ext&#038;ver=4.3.1" type="text/css" media="all">
    <link rel="stylesheet" id="noticia-text-css" href="https://fonts.googleapis.com/css?family=Noticia+Text:400,400italic,700,700italic&#038;subset=latin" type="text/css" media="all">
    <link rel="stylesheet" id="fontello-css" href="static/css/fontello.css" type="text/css" media="all">
    <link rel="stylesheet" id="fluidbox-css" href="static/css/fluidbox.css" type="text/css" media="all">
    <link rel="stylesheet" id="main-css" href="static/css/main.css" type="text/css" media="all">
    <link rel="stylesheet" id="768-css" href="static/css/768.css" type="text/css" media="all" media="(min-width: 768px)">
    <link rel="stylesheet" id="992-css" href="static/css/992.css" type="text/css" media="all" media="(min-width: 992px)">
    <link rel="stylesheet" id="1200-css" href="static/css/1200.css" type="text/css" media="all" media="(min-width: 1200px)">
    <link rel="stylesheet" id="1400-css" href="static/css/1400.css" type="text/css" media="all" media="(min-width: 1400px)">
    <link rel="stylesheet" id="wp-fix-css" href="static/css/wp-fix.css" type="text/css" media="all">
    <link rel="stylesheet" id="author-avatars-widget-css" href="static/css/widget.css" type="text/css" media="all">
    <link rel="stylesheet" id="author-avatars-shortcode-css" href="static/css/shortcode.css" type="text/css" media="all">

    <% for (var chunk of webpack.chunks) {
        for (var file of chunk.files) {
          if (file.match(/\.(js|css)$/)) { %>
    <link rel="<%= chunk.initial?'preload':'prefetch' %>" href="<%= htmlWebpackPlugin.files.publicPath + file %>" as="<%= file.match(/\.css$/)?'style':'script' %>"><% }}} %>
  </head>
  <body>
    <div id="app"></div>

    <%= htmlWebpackPlugin.options.serviceWorkerLoader %>
  </body>
</html>
